{
    text-align: center;
    height: 90%;
    width: 100%;
    font-size: 300px;
    color: white;
}

	height:100%;
	width:100%;

{
    text-decoration: blink;

</head>
<div id="countdown" style="z-index:25"></div>
<script>
var flag=0;
var path=location.pathname;
var index=path.lastIndexOf("/") + 1;
var index2=path.lastIndexOf(".");
var string1=path.substring(index,index2);
var maxtime=parseInt(string1);
var tempmin=maxtime;
var interval,time=maxtime;
var runningdown = 0;
function start(time) {
    var time = time*60;
    var el = document.getElementById('countdown');
    var minutes = Math.floor( time / 60 );
    if (minutes < 10) minutes = "0" + minutes;
    var seconds = time % 60;
    if (seconds < 10) seconds = "0" + seconds; 
    var text = minutes + ':' + seconds;
    el.innerHTML = text;   
}
window.onload = function() {
    start(maxtime);
}

function kd(event)
{
    if(event.keyCode==32){
      if(!flag){
        countdown("countdown",maxtime,0);
        flag=1;
      } else {
        pause();
      }
    } 
    else if(event.keyCode==82)res();
}
window.onkeydown=kd;
function countdown(element, minutes, seconds) {
    {
    time = minutes*60 + seconds;
    var prep = '';
    var el = document.getElementById(element);
    interval = setInterval(function() {
        if(runningdown==0) {
            time--;
        } else { 
            time++;
        }

        if(time==0){
            runningdown = 1;
            el.style.color='yellow';
        }
        if(time < 10 && runningdown == 0) {
            el.className = 'blink';
        }
        if(time > 0 && runningdown == 1) {
            prep = '-';
        }
        var minutes = Math.floor( time / 60 );
        if (minutes < 10) minutes = "0" + minutes;
        var seconds = time % 60;
        if (seconds < 10) seconds = "0" + seconds; 
        var text = minutes + ':' + seconds;
        el.innerHTML = prep + text;
    }, 1000);

    }
}


function pause()
{
    flag=0;
    maxtime=time/60;
    clearInterval(interval);
}

function res()
{
    flag=0;
    runningdown = 0;
    clearInterval(interval);
    start(tempmin);
    time = tempmin * 60;
    maxtime = tempmin;
}

</script>
